import React, { Component } from 'react';
import './Buku.css';

class Home extends Component {
    render() {
        return (
            <div className='card'>
                <div className='container'>
                    <div className='Titel'>
                        Buku
                    </div>
                    <div className='conten'>
                        Selamat Datang Di Hanabi Library
                    </div>
                </div>
            </div>
        );
    }
}

export default Home;
